import React from 'react';
import styles from './Menu.module.css';
import Social from './Social';
import Image from 'next/image';
import { motion } from 'framer-motion';


const Menu = () => {
  return (
    <div className={styles.welcomeMenu}>
      <div className={styles.logo}>
        <Image src="/restologo.png" alt="logo" width={100} height={100} />
      </div>
      <div className={styles.menu}>
        <div className={styles.menuTitle}>Menu</div>
        <nav>
          <ul>
            <li>
              <motion.a
                whileHover={{
                  color: 'red',
                }}
                href="#"
              >
                Menu
              </motion.a>
            </li>
            <li>
              <motion.a
                whileHover={{
                  color: 'red',
                }}
                href="#"
              >
                Waitlist
              </motion.a>
            </li>
            <li>
              <motion.a
                whileHover={{
                  color: 'red',
                }}
                href="#"
              >
                Gift Cards
              </motion.a>
            </li>
            <li>
              <motion.a
                whileHover={{
                  color: 'red',
                }}
                href="#"
              >
                Offers
              </motion.a>
            </li>
          </ul>
        </nav>
      </div>
      <Social />
    </div>
  );
};

export default Menu;
